import React from "react";

import "./Styles.css";
function Home() {
  return (
    <div className="centered">
      <div className="homeContainer">
        <div className="homeGreets">
          <h2>Welcome</h2>
          <span className="homeSpan"> to our restaurant</span>
        </div>
      </div>
    </div>
  );
}

export default Home;
